export default function MemberSectionOnMHP (){

    return (
<div className="row">
<div className="col-4">
<div className="card" style={{width: '18 px'}}>
  <img style={{width: '200px', height: '200px'}} className="card-img-top" src="../MemberPic.jpeg" alt="Card image cap"/>
  <div className="card-body">
    <h5 className="card-title">Card title</h5>
    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" className="btn btn-primary">Go somewhere</a>
  </div>
</div>

</div>

</div>


    );
}
